import RegisterForm from './components/RegisterForm';
import './App.css';
import Axios from 'axios'
import LoginForm from './components/LoginForm';
import { BrowserRouter, Route, Switch} from 'react-router-dom';
function App() {
  return (
    <div className="wrapper">
      <LoginForm />
      <BrowserRouter>
      <Switch>
        <Route path="/login">
          <LoginForm />
        </Route>
        <Route path="/signin">
          <RegisterForm />
        </Route>
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
